import React from 'react'

function NewCard({newWork}) {
  const   {medium, 
          artist, 
          title, 
          date, 
          image}= newWork

  return (
    <li className="card">
      {image === "" ? <img src={"https://upload.wikimedia.org/wikipedia/en/b/b9/MagrittePipe.jpg"} alt={"MagrittePipe"}/>:<img src={image} alt={artist}/> }
      {artist === "" ? <h4>Unknown</h4> : <h4>{artist}</h4> }
      <p className="title">{title}</p>
      <p>{date}</p>
      <p>{medium}</p>
    </li>
  )
}



export default NewCard
